import React from 'react';
import { Menu } from 'antd';

const MyMenu = ({ models, setModel }) => {
  const filterKeywords = ['llama3', 'qwen2']; // 示例过滤关键词

  const handleMenuClick = (e) => {
    setModel(e.key);
  };

  const items = models
    .filter((model) => filterKeywords.some((keyword) => model.name.includes(keyword)))
    .map((model) => ({
      key: model.name,
      label: model.name,
    }));

  return (
    <Menu onClick={handleMenuClick} style={{ width: '50%' }} mode="inline" items={[{key: 'select-model', label: '模型选择',items: items}]} />
  );
};

export default MyMenu;
